import JoinButton from '../component/joinbutton';
import LoginButton from '../component/loginbutton';


function SignPage(){
    return(
        <>
        <h1>로그인 페이지</h1>
        <div>
            <label> I  D : </label>
            <input type='text' name='input_id'/>
        </div>
        <div>
            <label>PW: </label>
            <input type='text' name='input_pw'/>
        </div>
        <LoginButton />
        <JoinButton />
        </>
    );
}

export default SignPage;
